['다른 드래곤들을 이용하여 드래곤의 레벨을 상승시키는 기능입니다.\n올라가는 경험치의 양은 다음과 같은 조건에 의해 달라지며,\n레벨업에 사용한 드래곤은 테이머님을 떠나갑니다.\n\n- {@YELLOW}기본 제공 경험치{@DEFAULT}: 레벨업에 사용한 드래곤의 등급과 레벨에 따라 상승합니다.\n- {@YELLOW}속성{@DEFAULT}: 레벨업 시킬 드래곤과 같은 속성의 드래곤을 사용할 경우 50%의 추가 경험치를 획득할 수 있습니다.\n- {@YELLOW}슬라임{@DEFAULT}: 게임 플레이 중 간혹 획득할 수 있는 슬라임은 매우 많은 경험치를 제공합니다.\n- {@YELLOW}추가 경험치{@DEFAULT}: 레벨업 기능 이용 시 낮은 확률로 보너스 경험치를 획득할 수 있으며, 친밀도가 높은 드래곤을 재료로 사용하면 확률이 상승합니다.']='Is feidhm é seo chun leibhéal dragan a mhéadú le cabhair ó dragain eile.\nTá an EXP breise a ghnóthaítear difriúil de réir na gcoinníollacha seo a leanas.\nFágfaidh dragain a úsáidtear le haghaidh Leibhéal suas an Tamer. \n\n- {@YELLOW} Réamhshocrú EXP{@DEFAULT}: méadaithe de réir Leibhéal agus Grád an dragain a úsáidtear don Leibhéal Suas. \n- {@YELLOW} Tréith{@DEFAULT}: Is féidir leat 50% sa bhreis EXP a thuilleamh má úsáideann tú dragan leis an aitreabúid chéanna agus an dragan is mian leat a leibhéalú. \n- {@YELLOW} Slime{@DEFAULT}: Is annamh a fhaigheann slimes a fhaightear le linn na gcluichí go leor EXP. \n- {@YELLOW} EXP Breise{@DEFAULT}: Agus an fheidhm Leibhéal Suas in úsáid agat, seans go bhfaighidh tú bónas EXP ar dhóchúlacht íseal. Méadaítear an seans má úsáideann tú dragan le géire ard mar ábhar.',
