['다른 테이머와 강함을 겨룰 수 있는 콜로세움의 입장권. 콜로세움에서 치룰 수 있는 대전의 수가 한정되어 있는만큼, 진정한 테이머로 인정받은 자들에게만 지급된다.']='An Ticéad Iontrála chun dul isteach sa Colosseum áit ar féidir leat dul san iomaíocht le Tamers eile. Toisc go bhfuil teorainn le líon na gcathanna atá ar fáil ag Colosseum , ní eisítear iad ach do Tamers a bhfuil a gcuid scileanna cruthaithe acu.',
