['드래곤 빌리지M에 등장하는 테이머와 드래곤들의 이야기를 볼 수 있는 기본 게임 모드입니다.\n총 12챕터로 이루어진 유타칸 세계에서 여러분과 함께 하는 테이머들의 모험 이야기를 즐겨 보세요!']='Is é seo an modh cluiche réamhshocraithe áit ar féidir leat foghlaim faoi na Tamers and Dragons of Dragon Village M.\nBain sult as eachtraí Yutacáin World comhdhéanta de 12 chaibidil!',
['드래곤 빌리지M에서 만날 수 있는 수많은 드래곤들은 다음과 같은 방법으로 획득 가능합니다.\n- {@YELLOW}알{@DEFAULT}: 퀘스트, 마스터의 길 등을 통해 획득한 알을 부화소에서 부화시켜 드래곤 획득\n- {@YELLOW}소환{@DEFAULT}: 부화소에서 다이아를 소비하여 드래곤들을 직접 소환하여 드래곤 획득\n- {@YELLOW}인연 포인트{@DEFAULT}: 어떤 드래곤의 인연 포인트를 정해진 만큼 모아 해당 드래곤 확정 획득']='Is féidir leat dragain éagsúla a fháil i Dragon Village M trí na modhanna seo a leanas. \n- {@YELLOW} Uibheacha{@DEFAULT}: y uibheacha goir a fuarthas ó Rompu, Conair an Mháistir, etc. ag an nGorlann (Toghairm). \n- {@YELLOW} Toghairm{@DEFAULT}: Trí dragain a thoghairm ag baint úsáid as Diamaint \n- {@YELLOW} Pointe Caidrimh{@DEFAULT}: Trí Pointí Caidrimh a bhailiú le haghaidh dragan chun a chinntiú go bhfaighidh tú dragan',
