['드래곤 중 가장 센 힘을 가진 드래곤. 앞발이 엄청 발달해 있다. 성격은 온순한 편. 태어나면서부터 엄청난 힘을 가지고 태어난다.']='An dragon is láidre. Tá a chos tosaigh an-láidir. Ina ionad sin milis. Tá cumhacht iontach aige fiú nuair is leanbh é.',
