['드래곤 치유 스킬 사용']='Bain úsáid as Dragon Recovery Scil',
['드래곤 테이머즈M에는 테이머님이 보유한 드래곤의 종류와 특성에 따라 4가지 진형 중 하나를 선택하여 전투를 더 유리하게 진행할 수 있습니다.\n모든 진형은 각각 다른 효과를 가지고 있으며 진형 레벨업으로 진형의 효과를 강화시킬 수 있습니다.']='Is féidir leat ceann amháin de 4 fhoirmíocht a roghnú de réir na gcineálacha dragain atá agat agus a dtréithe chun cath a dhéanamh níos fabhraí duit i Dragon Tamers M.\nTá éifeachtaí éagsúla ag gach foirmiú, agus is féidir leat na héifeachtaí a fheabhsú trí Fhoirmiú Leibhéal suas.',
['드래곤, 그들의 존재는 혼돈일까? 창조일까?']='Dragúin... An fórsaí cruthaithe nó scriosta iad?',
['드래곤과 {1}회 작별하기']='Slán le Dragon X {1}',
['드래곤과 몬스터들은 스킬을 통해서 아군을 강하게 하는 효과를 부여할 수 있습니다.\n\n- {@green}공격력 증가{@DEFAULT} : 공격력이 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}방어력 증가 {@DEFAULT}: 방어력이 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}공격속도 증가{@DEFAULT} : 공격속도가 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}치명확률 증가{@DEFAULT} : 치명확률이 30% 증가됩니다.\n- {@green}치명피해 증가{@DEFAULT} : 치명피해가 50% 증가됩니다.\n- {@green}치명회피 증가{@DEFAULT} : 치명회피가 30% 증가됩니다.\n- {@green}회피 증가{@DEFAULT} : 회피가 30% 증가됩니다.\n- {@green}적중 증가{@DEFAULT} : 적중이 30% 증가됩니다.\n- {@green}무적{@DEFAULT} : 모든 피해를 받지 않습니다. 해로운 효과에는 걸릴 수 있습니다.\n- {@green}좀비{@DEFAULT} : 생명력이 0이 될 때 발동하며 죽지 않는 상태가 됩니다. 지속시간이 끝나면 바로 사망합니다.\n스킬에 따라 공격속도 300% 증가 혹은 치명확률 50% 증가의 비약적 증가 효과를 함께 얻습니다.\n- {@green}보호막{@DEFAULT} : 보호막이 가지고 있는 생명력 만큼의 피해를 방어합니다.\n- {@green}반사{@DEFAULT} : 적으로부터 받는 피해의 80%만 받으며 나머지 20%의 피해를 공격자에게 되돌립니다.\n- {@green}면역{@DEFAULT} : 모든 해로운 효과에 걸리지 않습니다. 이미 걸린 해로운 효과는 해제되지 않습니다.\n- {@green}흡혈{@DEFAULT} : 적에게 피해를 입혔을 때 피해량의 10%를 자신의 생명력으로 회복합니다.']='Is féidir le dragain agus arrachtaigh éifeachtaí tairbheacha a thabhairt do chomhghuaillithe. \n\n- {@green} Méadaigh ATK{@DEFAULT}: Méadaítear ATK 20%. (Is féidir é a chruachadh suas le 3 huaire) \n- {@green} Méadaigh DEF {@DEFAULT}: Méadaítear DEF 20%. (Is féidir é a chruachadh suas le 3 huaire) \n- {@green} Méadaigh Luas ATK {@DEFAULT}: Tháinig méadú 20% ar luas ATK. (Is féidir é a chruachadh suas le 3 huaire) \n- {@green} Méadaigh an Ráta Criticiúil{@DEFAULT}: Tháinig méadú 30% ar an Ráta Criticiúil. \n- {@green} Méadaigh DMG Criticiúil{@DEFAULT}: Méadaítear DMG criticiúil 50%. \n- {@green} Méadaigh Imghabháil Criticiúil{@DEFAULT}: Méadaítear Imghabháil Chriticiúil 30%. \n- {@green} Méadaigh Imghabháil{@DEFAULT}: Méadaítear an imghabháil faoi 30%. \n- {@green} Méadaigh ACC{@DEFAULT}: Méadaítear ACC 30%. \n- {@green} Invulnerable{@DEFAULT}: Imdhíonacht do gach ionsaí, ach fós buailte ag éifeachtaí díobhálacha. \n- {@green} Zombie{@DEFAULT}: Gníomhaíonn sé nuair a shroicheann HP 0. Ní bhfaighidh Dragon bás go dtí go mbeidh deireadh leis.\nFaigh ceann amháin de na héifeachtaí drámatúla seo, méadú 300% ar ATK Speed ​​nó méadú 50% ar Chriticiúil Ráta, de réir scile. \n- {@green} Bacainn{@DEFAULT}: Cuirtear in aghaidh damáiste atá comhionann le HP an bhacainn. \n- {@green} Machnamh{@DEFAULT}: Ná faigh ach 80% den damáiste ón namhaid, agus cuir 20% ar ais chuig an ionsaitheoir. \n- {@green} Imdhíonacht{@DEFAULT}: Imdhíonacht do gach tionchar díobhálach. Ní bhaintear éifeachtaí díobhálacha reatha. \n- {@green} Ionsú HP{@DEFAULT}: Ghnóthaigh 10% den damáiste a rinneadh don namhaid mar HP.',
['드래곤과 몬스터들은 스킬을 통해서 적을 약하게 하는 효과를 부여할 수 있습니다.\n\n- {@YELLOW}공격력 감소{@DEFAULT} : 공격력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}방어력 감소{@DEFAULT} : 방어력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}공격속도 감소{@DEFAULT} : 공격속도가 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}치명확률 감소{@DEFAULT} : 치명확률이 30% 감소됩니다.\n- {@YELLOW}치명회피 감소{@DEFAULT} : 치명회피가 30% 감소됩니다.\n- {@YELLOW}회피 감소{@DEFAULT} : 회피가 30% 감소됩니다.\n- {@YELLOW}적중 감소{@DEFAULT} : 적중이 30% 감소됩니다.\n- {@YELLOW}회복량 감소{@DEFAULT} : 회복을 받았을 때 회복량이 70% 감소됩니다.\n- {@YELLOW}기절{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다.\n- {@YELLOW}수면{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다. 공격을 받았을 때 해제됩니다.\n- {@YELLOW}침묵{@DEFAULT} : 모든 스킬을 사용할 수 없습니다.\n- {@YELLOW}지속피해{@DEFAULT} : 일정 시간마다 최대 생명력의 0.5%의 피해를 받습니다. (최대 3회까지 중첩 가능)']='Is féidir le dragain agus arrachtaigh éifeachtaí díobhálacha a thabhairt do naimhde. \n\n- {@YELLOW} Laghdú ar ATK{@DEFAULT}: Tháinig laghdú 20% ar ATK. (Is féidir é a chruachadh suas le 3 huaire) \n- {@YELLOW} Laghdú DEF {@DEFAULT}: Tá laghdú 20% ar an DEF. (Is féidir é a chruachadh suas le 3 huaire) \n- {@YELLOW} Laghdú ar Luas ATK {@DEFAULT}: Laghdaítear luas ATK 20%. (Is féidir é a chruachadh suas le 3 huaire) \n- {@YELLOW} Laghdú ar an Ráta Criticiúil{@DEFAULT}: Laghdaítear an Ráta Criticiúil faoi 30%. \n- {@YELLOW} Laghdú ar Imghabháil Chriticiúil{@DEFAULT}: Tá laghdú 30% ar an Imghabháil Chriticiúil. \n- {@YELLOW} Laghdú ar Imghabháil{@DEFAULT}: Tá laghdú 30% ar an imghabháil. \n- {@YELLOW} Laghdú ACC{@DEFAULT}: Tháinig laghdú 30% ar an ACC. \n- {@YELLOW} Laghdú ar an Ráta Aisghabhála{@DEFAULT}: Laghdaíodh an méid athshlánaithe 70%. \n- {@YELLOW} Stiúradh{@DEFAULT}: Ní féidir ionsaí a dhéanamh ná scileanna a úsáid. \n- {@YELLOW} Codladh{@DEFAULT}: Ní féidir gach scil a úsáid agus ní féidir ionsaí a dhéanamh. Baineadh an stádas nuair a ionsaíodh é. \n- {@YELLOW} Tost{@DEFAULT}: Ní féidir gach scil a úsáid. \n- {@YELLOW} Damáiste DOT{@DEFAULT}: Faigh damáiste 0.5% de Max HP gach am socraithe. (Is féidir é a chruachadh suas le 3 huaire)',
['드래곤도 룬이라는 장비를 착용할 수 있어요.']='Is féidir le dragain runes a threalmhú.',
['드래곤들 날개를 닦아주는 중...']='Sciatháin na dragain á ngearradh...',
