['드래곤들은 각각의 특성에 따라 {@RED}공격{@DEFAULT}, {@BLUE}방어{@DEFAULT}, {@grass_green}회복{@DEFAULT}, {@purple}지원{@DEFAULT} 중 하나의 직군을 가집니다.\n\n- {@RED}공격{@DEFAULT}: 몬스터들을 공격하는 것에 특화된 드래곤입니다.\n- {@BLUE}방어{@DEFAULT}: 아군 드래곤들 앞에서 몬스터의 공격을 방어하며 지켜주는 드래곤입니다.\n- {@grass_green}회복{@DEFAULT}: 충격을 입은 드래곤들의 HP를 회복하는 등 파티의 생존력을 높여주는 드래곤입니다.\n- {@purple}지원{@DEFAULT}: 아군 드래곤의 공격을 강화하거나, 몬스터의 공격을 방해하는 등 파티를 지원하는 드래곤입니다.']='Tá 1 slí bheatha ag gach dragan ina measc seo a leanas: {@RED} Attack{@DEFAULT}, {@BLUE} Defense{@DEFAULT}, {@grass_green} Aisghabháil{@DEFAULT}, nó {@purple} Tacaíocht{@DEFAULT}. \n\n- {@RED} Ionsaí{@DEFAULT}: Speisialaithe in ionsaí arrachtaigh. \n- {@BLUE} Cosaint{@DEFAULT}: Cosnaíonn dragain eile ag an tosach. \n- {@grass_green} Aisghabháil{@DEFAULT}: Speisialaithe ar mharthanacht dragain eile a fheabhsú trí HP dragain damáiste a athchóiriú. \n- {@purple} Tacaíocht{@DEFAULT}: Speisialaithe ar éifeachtaí tairbheacha a sholáthar do chomhghuaillithe nó éifeachtaí díobhálacha ar naimhde.',
['드래곤들은 자신의 속성에 따라 식성이 다릅니다.\n테이머님이 좋아하는 드래곤은 어떤 열매가 취향일까요?']='Bíonn aiste bia éagsúil ag gach dragan de réir a tréithe.\nCén cineál torthaí a thaitneoidh leis an dragan is fearr leat?',
['드래곤들을 부르는 중...']='Dragons ag glaoch...',
['드래곤들의 진형에 따라 전투의 결과가 달라질 수 있습니다.\n보유하신 드래곤들에게 가장 잘 어울리는 진형을 골라보세요!']='Seans go n-athróidh foirmiú dragain toradh an chatha.\nRoghnaigh an foirmiú is oiriúnaí do na dragain.',
['드래곤에게 자립심을 길러주세요.']='Ná déan dearmad neamhspleáchas a chothú i measc do chuid dragain.',
['드래곤에그가 아니라, 에그드래곤!']='Dragon ubh! Ní ubh dragan.',
['드래곤은 11종류의 능력치를 가지고 있으며 드래곤의 종류에 따라 시작 능력치가 다릅니다.\n공격력, 방어력, 생명력은 드래곤의 레벨업, 진화, 승급을 통해 상승시킬 수 있으며 그 외 능력치는 룬이나 스킬 등을 통해서만 상승시킬 수 있습니다.\n\n- {@RED}공격력{@DEFAULT} : 일반공격 및 스킬공격의 피해량이 증가됩니다.\n- {@pink}방어력{@DEFAULT} : 적의 공격을 받았을 때 피해량이 감소됩니다.\n- {@YELLOW}생명력{@DEFAULT} : 드래곤의 최대 생명력이 증가되어 더 오래 생존할 수 있습니다.\n- {@BLUE}공격속도{@DEFAULT} : 드래곤이 일반공격을 하는 빈도가 높아집니다.\n- {@purple}치명확률{@DEFAULT} : 드래곤이 공격을 할 때 치명타가 발생하는 확률이 증가됩니다.\n- {@pink}치명피해{@DEFAULT} : 드래곤의 공격에 치명타가 발생했을 때의 피해량이 증가됩니다.\n- {@green}치명회피{@DEFAULT} : 적에게 치명타를 받았을 때 치명타를 무효시키는 확률이 증가됩니다. 치명회피에 성공하면 치명타 피해가 아닌 일반 피해를 받게 됩니다.\n- {@YELLOW}회피{@DEFAULT} : 적의 공격을 회피하는 확률이 증가됩니다. 회피는 일반공격, 패시브 스킬, 드래그 스킬 등 모든 공격에 적용되며 회피에 성공하면 피해를 입지 않게 됩니다.\n- {@grass_green}적중{@DEFAULT} : 적에게 공격을 명중시키는 확률이 증가됩니다. 회피가 높은 적에게 유용합니다.\n- {@green}효과저항{@DEFAULT} : 적의 스킬로 해로운 효과가 발생할 때 효과를 무효시키는 확률이 증가됩니다.\n- {@RED}효과적중{@DEFAULT} : 효과저항을 가진 적의 저항 확률을 낮춥니다. 최소 15% 이하로는 효과저항을 낮추지 못합니다.']='Tá 11 chineál stats ag gach dragan, agus tá difríocht idir stats réamhshocraithe ag brath ar chineál an dragain.\nIs féidir ATK, DEF, HP a mhéadú faoi Leibhéal suas, Éabhlóid, Céim suas, ach ní féidir stats eile a mhéadú ach amháin le Runes nó Skills. \n\n- {@RED} ATK{@DEFAULT}: Méadú ar an damáiste de bharr ionsaithe agus scileanna gnáth. \n- {@pink} DEF{@DEFAULT}: Faigh níos lú damáiste nuair a ionsaítear é. \n- {@YELLOW} HP{@DEFAULT}: Méadaítear Dragon\'s Max HP, rud a fhágann go mairfidh sé i gcathanna. \n- {@BLUE} ATK Speed{@DEFAULT}: Déanann Dragon ionsaí gnáth níos minice. \n- {@purple} Ráta Criticiúil{@DEFAULT}: Méadaítear an seans chun Amais Chriticiúla a dhéanamh. \n- {@pink} DMG Chriticiúil{@DEFAULT}: Méadaítear an damáiste nuair a fhaigheann dragan Buail Criticiúil. \n- {@green} Imghabháil Chriticiúil{@DEFAULT}: Méadaítear an seans chun Amais Chriticiúla isteach a dhiúltú. Má éiríonn le Dragon Imghabháil Chriticiúil, glacann sé gnáthdhamáiste ina ionad. \n- {@YELLOW} Imghabháil{@DEFAULT} : Méadaítear an seans ionsaí namhaid a imghabháil. Cuirtear imghabháil i bhfeidhm ar gach ionsaí cosúil le gnáth-ionsaithe, scileanna éighníomhacha, scileanna Tarraing, etc. Ní fhaigheann Dragon aon damáiste má seachnaíonn sé ionsaí go rathúil. \n- {@grass_green} ACC{@DEFAULT}: Méadaítear an seans go mbuailfidh tú namhaid. Tá an stat seo riachtanach nuair a bhíonn tú ag troid le namhaid le himghabháil ard. \n- {@green} Friotaíocht Éifeacht{@DEFAULT}: Seans éifeachtaí díobhálacha a dhiúltú ó scileanna naimhde. \n- {@RED} Cruinneas Éifeacht{@DEFAULT}: Laghdaigh seans an namhad cur i gcoinne na héifeachta. Ní féidir an Friotaíocht Éifeacht a laghdú faoi bhun 15%.',
['드래곤은 고향으로 돌아가며 선물로 라테아를 남깁니다.']='Fágann Dragon Latea nuair a fhilleann sé ar a thír dhúchais.',
