['드래곤을 선택하세요.']='Roghnaigh dragon.',
['드래곤을 현재 등급의 최대 레벨까지 성장시킨 후에 사용할 수 있는 드래곤의 등급 상승 방법입니다.\n드래곤을 승급시키려면 해당 드래곤의 등급과 같거나 더 높은 드래곤을 등급 수 만큼 준비해야 합니다.\n예) {@YELLOW}3등급 드래곤{@DEFAULT}을 {@YELLOW}4등급으로 승급{@DEFAULT}시키기 위해서는, {@YELLOW}3등급 이상의 드래곤{@DEFAULT}이 {@YELLOW}3마리{@DEFAULT} 필요합니다.']='Is féidir dragain a rangú tar éis Uasleibhéal an ghráid reatha a bhaint amach.\nChun céim suas, beidh an líon céanna dragain ag an ngrád céanna nó ag an ngrád níos airde ag teastáil uait agus atá ag leibhéal reatha an dragain chun céim suas. {@YELLOW} Dragon Grád 3 {@DEFAULT} {@YELLOW} go Grád 4{@DEFAULT}, teastaíonn {@YELLOW} 3 dragan{@DEFAULT} le {@YELLOW} Grád 3 nó níos airde{@DEFAULT}.',
['드래곤의 {@YELLOW}인연 포인트{@DEFAULT}를 사용해 드래곤을 추가로 성장시키는 기능입니다.\n드래곤을 강화시키려면 {@YELLOW}같은 이름의 드래곤{@DEFAULT}의 {@YELLOW}인연 포인트{@DEFAULT}\n혹은 드래곤 등급에 맞는 {@YELLOW}강화 포인트{@DEFAULT}가 필요합니다.']='Baintear úsáid as an bhfeidhm seo chun do dhragon a mhéadú tuilleadh trí úsáid a bhaint as {@YELLOW} Pointe Caidrimh{@DEFAULT}.\nChun dragan a fheabhsú, teastaíonn {@YELLOW} Pointe Caidrimh{@DEFAULT} ó {@YELLOW} den dragan céanna{@DEFAULT }\nor {@YELLOW} Pointí Feabhsúcháin{@DEFAULT} ag teastáil dá Grád.',
