['드래곤의 숲을 레벨업했습니다.']='Méadaítear Leibhéal Dragon Forest.',
['드래곤의 스킬 1개가\n무작위로 레벨다운됩니다.']='Cailleann Dragon 1 leibhéal le scil randamach.',
