['드래곤의 장비!']='Trealamh Dragon!',
['드래곤의 진화에 사용되는 각종 진화 재료를 얻을 수 있는 던전입니다.\n거대용들의 특성을 파악하고 속성을 공략해, 여러분의 드래곤을 진화시켜보세요.\n\n<보스 정보>\n- {@YELLOW}보석 거대용{@DEFAULT}: 보석 거대용은 생명력이 매우 높지만, 난이도 자체는 평범합니다.\n- {@grass_green}땅의 거대용{@DEFAULT}: 물속성 드래곤에게 큰 피해를 줍니다.\n- {@BLUE}물의 거대용{@DEFAULT}: 불속성 드래곤에게 큰 피해를 줍니다.\n- {@RED}불의 거대용{@DEFAULT}: 땅속성 드래곤에게 큰 피해를 줍니다.\n- {@YELLOW}빛의 거대용{@DEFAULT}: 어둠속성 드래곤에게 큰 피해를 줍니다.\n- {@GRAY}어둠의 거대용{@DEFAULT}: 빛속성 드래곤에게 큰 피해를 줍니다.']='Is dungeon é seo inar féidir leat Ábhair Éabhlóid éagsúla a fháil a theastaíonn le haghaidh éabhlóide.\nFaigh amach tréithe Dragúin Mhóra agus bain úsáid as a dtréithe ina gcoinne chun do chuid dragain a fhorbairt. \n\n<Boss Info> \n- {@YELLOW} Dragon Gem ollmhór {@DEFAULT}: Tá HP an-ard ag Massive Gem Dragon , ach níl sé deacair a mharú. \n- {@grass_green} Dragon Mhór Domhan {@DEFAULT}: Déanann sé an-dochar do Dragain Uisce . \n- {@BLUE} Dragon Uisce Ollmhór {@DEFAULT}: Déanann sé dochar mór do Dóiteáin Dragons. \n- {@RED} Dragon Dóiteáin{@DEFAULT}: Déanann sé dochar mór do Dhragúin Domhan . \n- {@YELLOW} Dragon Solas Ollmhór {@DEFAULT}: Déanann sé dochar mór do Dhragúin Dorcha . \n- {@GRAY} Dragon Mór Dorcha {@DEFAULT}: Déanann sé damáiste mór do Solas Dragons.',
['드래곤의 최대레벨이 10 증가하였습니다!']='Tháinig méadú 10 ar leibhéal Dragon\'s Max!',
['드래곤의 힘을 더 강하게 할 수 있는 룬을 얻을 수 \n 있는 곳으로, 악몽 던전에서만 발견되는 룬도 있다고 합니다.']='Ag iarraidh do dhragon a dhéanamh níos láidre fós?\nDeirtear nach féidir roinnt runes a fháil ach amháin i Nightmare Dungeon.',
['드래곤이 가득 찼습니다.\n인벤토리 공간을 확보 후 전투를 시작할 수 있습니다.']='Tá dragain lán.\nIs féidir leat tús a chur leis an gcath nuair a gheobhaidh tú roinnt spáis.',
['드래곤이 가진 스킬은 레벨이 높을 수록 스킬 능력이 강화되어 전투를 더 유리하게 진행할 수 있습니다.\n스킬의 레벨을 상승시키려면 {@YELLOW}같은 이름의 드래곤{@DEFAULT} 혹은 {@YELLOW}스킬 슬라임{@DEFAULT}이 필요하며, 최고 레벨이 아닌 보유 스킬 중 하나가 무작위로 레벨이 상승합니다.']='Éiríonn scileanna dragain níos láidre agus cuireann siad an cath níos fabhraí duit de réir mar a mhéadaíonn a leibhéal.\nChun leibhéal scileanna dragain a mhéadú, beidh an {@YELLOW} dragan céanna{@DEFAULT} nó {@YELLOW} Skill Slime{@DEFAULT} uait . Ansin, méadaítear leibhéal scile randamach nár bhain an Leibhéal Uasta amach.',
['드래곤이 가진 스킬의 종류에 따라 {@YELLOW}조건부로 발동{@DEFAULT}하는 자동 스킬입니다.\n발동 조건은 드래곤의 스킬에 따라 각각 다르며, 드래곤 관리 화면에서 확인하실 수 있습니다.']='Scil uathoibríoch {@YELLOW} a chuirtear i ngníomh go coinníollach{@DEFAULT}, ag brath ar an gcineál scile atá ag do dhragon.\nTá an riocht gníomhacht difriúil ó scileanna na dragain, agus is féidir é a sheiceáil faoin gCluaisín Bainistíochta Dragon .',
['드래곤이 강한 정도를 나타내는 보조적인 정보입니다.\n전투력이 낮더라도 파티의 조합과 스킬의 활용에 따라 충분히 극복 가능합니다.']='Eolas breise a thaispeánann cé chomh láidir is atá dragan.\nCé go bhfuil sé lag, is féidir é a shárú trí chomhdhéanamh cóisire agus úsáid scileanna.',
['드래곤이 얼마나 희귀한지를 나타내는 정보입니다.\n드래곤이 희귀할수록 더 강하고 좋은 스킬을 가지고 있으며, 드래곤이 희귀할수록 드래곤의 최초 등급이 더 높습니다.\n\n- 일반 희귀도: 1~2등급 상태로 획득\n- {@BLUE}희귀 희귀도{@DEFAULT}: 3등급 상태로 획득\n- {@purple}영웅 희귀도{@DEFAULT}: 4등급 상태로 획득\n- {@YELLOW}전설 희귀도{@DEFAULT}: 5등급 상태로 획득']='Léiríonn an fhaisnéis seo cé chomh tearc is atá dragan.\nTá scileanna níos láidre agus níos fearr ag dragain, chomh maith le Grád tosaigh níos airde. \n\n- Gnáth: Faigh mar Grád 1-2 \n- {@BLUE} Annamh{@DEFAULT}: Faigh mar Ghrád 3 \n- {@purple} Laoch{@DEFAULT}: Faigh mar Ghrád 4 \n- {@YELLOW} Finscéalach{@DEFAULT}: Faigh mar Ghrád 5',
['드래곤이 없습니다.']='Uimh dragons san fhardal.',
['드래곤이 좋아하는 열매를 얻을 수 있는 던전으로, 열매를 얻어 드래곤의 친밀도를 높일 수 있습니다.\n\n<보스 정보>\n- {@grass_green}땅의 거목{@DEFAULT}: 물속성 드래곤에게 큰 피해를 줍니다.\n- {@BLUE}물의 거목{@DEFAULT}: 불속성 드래곤에게 큰 피해를 줍니다.\n- {@RED}불의 거목{@DEFAULT}: 땅속성 드래곤에게 큰 피해를 줍니다.\n- {@YELLOW}빛의 거목{@DEFAULT}: 어둠속성 드래곤에게 큰 피해를 줍니다.\n- {@GRAY}어둠의 거목{@DEFAULT}: 빛속성 드래곤에게 큰 피해를 줍니다.']='Is dungeon é seo áit ar féidir leat torthaí éagsúla a thaitníonn le do chuid dragain a fháil, agus is féidir leat Dlúthpháirtíocht a mhéadú leis na torthaí seo. \n\n<Boss Info> \n- {@grass_green} Crann Domhan Ollmhór{@DEFAULT}: Déan damáiste mór do Uisce Dragons. \n- {@BLUE} Crann Uisce Ollmhór{@DEFAULT}: Déan damáiste mór do Dóiteáin Dragons. \n- {@RED} Crann Dóiteáin Ollmhór{@DEFAULT}: Déan damáiste mór do Dhragúin Domhan . \n- {@YELLOW} Crann Solas Ollmhór{@DEFAULT}: Déan damáiste mór do Dhragúin Dorcha . \n- {@GRAY} Crann Dorcha Ollmhór{@DEFAULT}: Déan damáiste mór do Solas Dragons.',
['드래곤이 희귀할수록 처음 획득했을 때의 등급이 높아집니다.\n다만 낮은 등급의 드래곤도 계속 키워나가면 6등급까지 성장시킬 수 있으니, 맘에 드는 드래곤을 마지막까지 함께 하실 수 있습니다.']='Dá annamha an dragan, is ea is airde an Grád tosaigh.\nMar sin féin, is féidir dragain le Grád tosaigh níos ísle a fhás suas go Grád 6, ionas gur féidir leat an dragan is mian leat a choinneáil go dtí an deireadh.',
