['룬은 가공하기 전 원석의 신비한 색상을 그대로 띄게 되는데, 같은 색상의 룬을 여러 개 가지게 되면 룬의 효과가 대폭 증폭됩니다.\n원석의 색상은 정말 다양하지만, 현재 가공에 성공한 룬의 색상은 총 8가지로, 그 효과는 다음과 같습니다.\n\n- {@YELLOW}체력 룬(노랑){@DEFAULT}: 생명력 증가\n- {@purple}기회 룬(보라){@DEFAULT}: 치명 확률 증가\n- {@grass_green}효과 적중 룬(녹색){@DEFAULT}: 효과 적중 증가\n- {@light_red}견고 룬(주황){@DEFAULT}: 방어력 상승\n- {@green}효과 저항 룬(청록){@DEFAULT}: 각종 효과 저항 확률 증가\n- {@RED}강렬 룬(빨강){@DEFAULT}: 공격력 증가\n- {@pink}피해 룬(분홍){@DEFAULT}: 치명 피해 증가\n- {@BLUE}쾌속 룬(파랑){@DEFAULT}: 공격 속도 증가']='Bíonn dath ar rúitín sula bpróiseáiltear iad, agus méadaíonn go mór a gcumhacht má dhéantar il-Rúnna ar an dath céanna.\nTá go leor mianta ann a bhfuil dathanna éagsúla orthu, ach faoi láthair ní phróiseáiltear ach 8 rúid. Is iad seo a leanas a n-éifeachtaí. \n\n- {@YELLOW} HP Rune(Buí){@DEFAULT}: Méadú HP \n- {@purple} Rúit Deiseanna(Corcra){@DEFAULT}: Méadaigh Ráta Criticiúil \n- {@grass_green} Cruinneas na héifeachta Rune(Green){@DEFAULT}: Méadaigh Cruinneas Éifeachta \n- {@light_red} Rith Solidity(Oráiste){@DEFAULT}: Méadaigh DEF \n- {@green} Rúit Friotaíocht Éifeacht(Turquoise){@DEFAULT}: Méadú Ráta Frithsheasmhachta Éifeachta \n- {@RED} D\'fhéadfadh Rune(Dearg){@DEFAULT}: Méadú ATK \n- {@pink} Damáiste Rune(Pink){@DEFAULT}: Méadaigh DMG Criticiúil \n- {@BLUE} Swift Rune(Gorm){@DEFAULT}: Méadaigh Luas ATK',
