['클랜은 서로 뜻이 맞는 테이머님들이 연합할 수 있는 단체입니다.\n{@YELLOW}레벨 15{@DEFAULT} 이상의 테이머님은 클랜을 새로 만들거나 가입할 수 있습니다.\n클랜원들이 {@YELLOW}고대의 탑, 콜로세움, 클랜던전{@DEFAULT}에 참여하면 성적에 따라 클랜 랭킹이 집계되고\n{@YELLOW}클랜코인{@DEFAULT} 보상을 받을 수 있습니다. 클랜코인은 상점에서 희귀한 물품과 교환할 수 있습니다.']='Is eagraíocht é A Clan inar féidir le suirí a bhfuil an sprioc chéanna acu teacht le chéile.\nIs féidir le daoine ag {@YELLOW} Leibhéal 15{@DEFAULT} nó níos airde clan nua a chruthú nó páirt a ghlacadh i clan atá ann cheana féin.\nNuair a ghlacann Baill Clan páirt in {@YELLOW} An Túr Ársa, an Colosseum, nó Clan Dungeon{@DEFAULT}, déanfar a Rangú Clan a ríomh de réir a dtorthaí,\nagus {@YELLOW} Is féidir luach saothair a fháil ó Bhoinn Chlann{@DEFAULT}. Is féidir Boinn Chlann a mhalartú le haghaidh earraí neamhchoitianta sa siopa.',
