['고대 유적 던전에서 발견할 수 있는 고대 룬은 일반 룬에는 없는 특별한 효과를 가지고 있습니다. \n현재 발견된 고대 룬의 종류는 6가지로, 그 효과는 다음과 같습니다.\n\n- {@RED}흡혈 룬{@DEFAULT} : 자신이 준 피해량의 10% 만큼 생명력을 회복합니다.\n세트 효과 중복 시 회복량이 증가합니다.\n- {@BLUE}명상 룬{@DEFAULT} : 12초마다 마나 1개를 획득합니다.\n- {@YELLOW}반격 룬{@DEFAULT} : 피해를 받으면 공격한 대상에게 즉시 반격합니다.\n반격에는 1초의 재사용 시간이 존재하며, 피해량은 자신의 방어력과 최대 생명력에 비례합니다.\n- {@GRAY}생존 룬{@DEFAULT} : 생명력이 30% 이하가 될 때 5초간 무적 효과를 적용받습니다.\n세트 효과 적용 시 무적 시간이 증가합니다.\n- {@grass_green}결의 룬{@DEFAULT} : 자신보다 후방에 위치한 아군이 받는 피해를 20% 확률로 대신 받습니다.\n- {@purple}앙심 룬{@DEFAULT} : 피해를 받을 때 20% 확률로 드래그 스킬 재사용 시간이 1초 감소합니다.\n세트 효과 중복 시 효과 발동 확률이 증가합니다.']='Tá éifeachtaí uathúla ag Runes Ársa a fhaightear sa Dungeon Fothracha Ársa nach bhfuarthas in aon ghnáth-Rúnna. \nFaoi láthair, tá 6 chineál Rúití Ársa ann. Is iad seo a leanas a n-éifeachtaí. \n\n- {@RED} Rith Ionsúite HP{@DEFAULT}: Ghnóthaigh HP cothrom le 10% den damáiste a rinne an namhaid.\nNuair a chruann na héifeachtaí socraithe, méadaítear an méid athshlánaithe. \n- {@BLUE} Rith Machnaimh{@DEFAULT}: Faigh 1 Mana gach 12 soicind. \n- {@YELLOW} Counterattack Rune{@DEFAULT}: Nuair a dhéantar damáiste, buaileann sé ar ais láithreach.\nTá 1 soicind ann. fuarú tar éis gach frithionsaí, agus tá an damáiste comhréireach le do DEF agus Max HP. \n- {@GRAY} Riú Marthanais{@DEFAULT}: Éiríonn sé dosháraithe ar feadh 5 soicind. nuair a shroicheann HP faoi bhun 30%.\nMéadaítear an ré nuair a bhíonn an éifeacht socraithe gníomhach. \n- {@grass_green} Rith Cinnidh{@DEFAULT}: Seans 20% damáiste a dhéanamh in ionad na gcomhghuaillithe taobh thiar de. \n- {@purple} Grudge Rune{@DEFAULT}: Seans 20% chun fuarú scile Tarraing a laghdú faoi 1 soicind. nuair a dhéantar damáiste.\nMéadaítear an Ráta Gníomhachtaithe nuair a chruaítear an éifeacht socraithe.',
