['드래곤 경험치, 룬, 자수정 획득 가능']='Is féidir Dragon EXP, runes, nó Amethysts a fháil.',
['일일 한정 상품 구매 가능']='Is féidir earraí teoranta laethúla a cheannach.',
['진화 재료 획득 가능']='Is féidir a fháil Ábhair Éabhlóid .',
['고대 주화, 전설 스킬 슬라임 획득 가능']='Is féidir Boinn Ársa nó Slimes Scil Finscéalta a fháil.',
['드래곤 인연 포인트 구매 가능']='Is féidir Pointí Caidrimh Dragon a cheannach.',
['명예, 용맹훈장 획득 가능']='Is féidir Boinn Onóra nó Luacha a fháil.',
['전설 드래곤 및 다양한 상품 뽑기 가능']='Is féidir a tharraingt Dragons Legendary nó míreanna eile.',
['일반 룬 획득 가능']='Is féidir a fháil Runes Gnáth .',
['날개, 다이아, 골드 획득 가능']='Is féidir Sciatháin, Diamaint, nó Óir a fháil.',
['클랜코인, 클랜 버프 획득 가능']='Is féidir Boinn Clan nó Clan Buff a fháil.',
['룬 연마석 획득 가능']='Is féidir Rune Enchant Stones a fháil.',
['신화의 알, 절대적인 전설의 알 획득 가능']='Is féidir leis Uibheacha Mythical nó Uibheacha Finscéalta Iomlána a fháil.',
['고대 룬, 아모르의 서 획득 가능']='An féidir runes Ársa nó Leabhair Amorru a fháil.',
['원하는 종류의 일반 룬 획득 가능']='Is féidir leat Gnáth Rúnna a fháil de do rogha féin.',
['클랜코인, 골드 획득 가능']='An féidir boinn nó Óir Clan a fháil.',
['드래곤 빌리지M의 무대가 되는 유타칸 세계에서 벌어지는 {@YELLOW}이야기{@DEFAULT}를 따라가며\n테이머와 드래곤을 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.']='Lean scéal {@YELLOW}{@DEFAULT} de Yutacáin, saol Dragon Village M,\nagus {@YELLOW} leibhéal suas{@DEFAULT} do chuimiléirí agus dragain.',
['모험 도중 우연히 만난 드래곤의 기억속에서 {@YELLOW}인연 포인트{@DEFAULT}를 얻을 수 있습니다.\n\n드래곤의 인연 포인트가 쌓이면 부화소에서 함께 할 수 있는 동료로 소환 할 수 있습니다.\n테이머님의 친구가 발견한 인연 던전에도 들어갈 수 있습니다.']='Faigh {@YELLOW} Pointí Caidrimh{@DEFAULT} ó chuimhní na dragain a mbuaileann tú leo le linn do eachtraíochta. \n\nLe Pointí Caidrimh, is féidir leat do chairde a ghairm ag an nGorlann (Toghairm). \nIs féidir leat Dungeons Caidrimh a d\'aimsigh do chairde a chur isteach freisin.',
['보유한 드래곤을 유타칸의 다양한 지역으로 {@YELLOW}탐험{@DEFAULT}을 보내 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.\n\n탐험을 보내기 위해서는 5마리의 드래곤이 필요하며, 탐험에서 발견한 룬과 자수정을 가지고 돌아옵니다.']='Seol do chuid dragain chuig {@YELLOW} iniúchadh a dhéanamh ar{@DEFAULT} réimsí eile den Yutacáin chuig {@YELLOW} leibhéal suas{@DEFAULT}. \n\nTá ar a laghad cúig dragan uait le seoladh le haghaidh taiscéalaíochta. Nuair a fhilleann siad, tugann siad ar ais Rúnais agus Aimitis a fuair siad.',
['하루에 한번 {@YELLOW}저렴한 가격{@DEFAULT}으로 상품을 구매할 수 있습니다.\n\n고급소환권과 골드, 모험에서 사용가능한 경험치와 골드 부스터 상품을 판매하고 있습니다.']='Uair sa lá, is féidir leat earraí a cheannach ar {@YELLOW} praghas níos ísle{@DEFAULT}. \n\nTá Ticéid Ardtoghairme, Óir, Teanndáileoga Óir agus EXP is féidir leat a úsáid le linn d\'eachtra ar fáil le ceannach.',
['오랜 시간 유타칸 세계의 신비한 힘을 흡수해 살아 움직이게 된 {@YELLOW}거목{@DEFAULT}이 등장합니다.\n\n거목을 물리치면 드래곤의 친밀도를 올리는 {@YELLOW}열매{@DEFAULT}를 얻을 수 있습니다.\n\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Tá {@YELLOW} Crainn Mhóra{@DEFAULT} ann atá beo tar éis dóibh cumhacht mistéireach Yutacáin a ionsú. \n\nNuair a bhualann tú na crainn sin, is féidir leat torthaí {@YELLOW} éagsúla{@DEFAULT} a fháil agus do chomh gar do na Dragúin a mhéadú. \n\nAthraíonn tréithe an dungeon is féidir leat a chur isteach do gach lá den tseachtain.',
['태초의 드래곤의 힘이 담긴 진화의 보석과 자연의 정기를 지키고 있는 거대용들의 서식지입니다.\n\n거대용들을 물리치면 {@YELLOW}드래곤을 진화{@DEFAULT}시킬 수 있는 {@YELLOW}보석과 정기{@DEFAULT}를 얻을 수 있습니다.\n진화한 드래곤은 모습이 변화하며 새로운 스킬을 얻어 더욱 강해집니다.\n\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Is gnáthóg Dragúin Ollmhóra é a chosnaíonn Gem Éabhlóid agus Fuinneamh ina bhfuil cumhacht na dragain. \n\nNuair a bhualann tú Dragons ollmhóra, gheobhaidh tú {@YELLOW} Éabhlóid Gem and Energy{@DEFAULT} a chuireann tús le {@YELLOW} Éabhlóid na nDragon{@DEFAULT}.\nNuair a thagann dragan chun cinn, athraíonn sé a chuma agus éiríonn níos cumhachtaí le scileanna nua. \n\nAthraíonn tréithe an dungeon is féidir leat a chur isteach do gach lá den tseachtain.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑입니다.\n\n더 높은 층으로 올라갈 수록 더욱 강력한 드래곤들을 물리쳐야만 합니다.\n매 층 클리어 시 다양한 보상을 얻을 수 있으며, {@YELLOW}층별 점수에 따라 순위가 결정{@DEFAULT}됩니다.\n\n고대의 탑은 2주마다 시즌이 종료되며 순위에 따라 {@YELLOW}고대주화{@DEFAULT}를 얻을 수 있습니다.']='Túr finscéalach a dhreap Tamers fadó chun iad féin a thástáil. \n\nTá tú ag troid le dragain níos cumhachtaí agus tú ag dul suas.\nFaigheann tú luaíochtaí éagsúla nuair a ghlanann tú gach urlár, agus tá {@YELLOW} rangaithe agat, bunaithe ar na pointí a scóráil tú do gach urlár{@DEFAULT}. \n\nMaireann gach séasúr den Túr Ársa ar feadh 2 sheachtain, agus is féidir leat {@YELLOW} Boinn Ársa{@DEFAULT} a fháil bunaithe ar do rangú.',
['마녀 나르비는 자신의 연구에 필요한 고대 주화를 수집하기 위해 상점을 열었습니다.\n고대의 탑에서 얻은 고대 주화를 {@YELLOW}드래곤 인연 포인트{@DEFAULT}와 다양한 아이템으로 교환할 수 있습니다.\n\n나르비의 변덕으로 상품이 주기적으로 바뀌는 특징이 있습니다.']='D’oscail Narvi siopa chun Boinn Ársa a bhailiú dá cuid taighde.\nIs féidir na Boinn Ársa a bhailíonn tú ón tSean-Thúr a mhalartú ar {@YELLOW} Pointí Caidrimh Dragon{@DEFAULT} agus nithe eile. \n\nAthraíonn sí na míreanna atá ar díol ó am go chéile, ag brath ar a giúmar.',
['콜로세움은 다른 테이머들과 강함을 겨룰 수 있는 경쟁의 무대입니다.\n\n전투에 참가한 테이머는 {@YELLOW}명예{@DEFAULT}를 획득할 수 있으며 승패에 따라 순위가 변동됩니다.\n매주 주말마다 시즌이 종료되며 순위에 따라 {@YELLOW}용맹 훈장{@DEFAULT}과 다이아를 얻을 수 있습니다.\n\n콜로세움에서 획득한 명예와 용맹 훈장은 상점에서 특별한 상품들과 교환 할 수 있습니다.']='Is réimse cath é Colosseum inar féidir leat dul san iomaíocht i gcoinne tamers eile. \n\nNuair a théann tú isteach sa chath, is féidir {@YELLOW} Onóir{@DEFAULT} a fháil agus déanfar tú a rangú bunaithe ar an toradh.\nCríochnaíonn gach séasúr ar an deireadh seachtaine, agus gheobhaidh tú {@YELLOW} Valor Medal{@ DEFAULT} agus Diamaint de réir do rangú. \n\nIs féidir an Bonn Onóra agus Luacha a bhailigh tú ag an Colosseum a mhalartú le haghaidh earraí speisialta sa siopa.',
['오래된 유적에서 발견된 신기한 캡슐을 뽑을 수 있는 곳입니다.\n\n캡슐을 뽑기위해서는 유타칸의 장인들이 가공한 {@YELLOW}캡슐 코인{@DEFAULT}이 필요합니다.\n캡슐중에는 {@YELLOW}전설 드래곤{@DEFAULT}과 같이 희귀한 상품이 들어있는 것도 있어 테이머들에게 늘 인기입니다.']='Is áit é seo inar féidir leat capsúil mistéireach a fhaightear ag fothracha ársa a tharraingt. \n\nChun capsúil a tharraingt, teastaíonn {@YELLOW} Boinn Capsúil{@DEFAULT} uait arna bpróiseáil ag gaibhne i ndomhan na Yutacáin.\nTá an-tóir ar chapsúil i measc na gcuimiléirí mar go bhfuil míreanna neamhchoitianta iontu ar nós {@YELLOW} Legendary Dragons{@DEFAULT }.',
['수많은 테이머와 드래곤을 괴롭힌 악몽의 화신이 살고있는 던전입니다.\n그들의 처절했던 전투의 흔적과 함께 룬들이 곳곳에 떨어져 있어 테이머를 유혹합니다.\n\n악몽의 화신을 물리치면 룬을 얻을 수 있고 {@YELLOW}높은 단계로 갈수록 등급이 더 높은 룬{@DEFAULT}을 얻을 수 있습니다.']='Is dungeon é seo ina bhfuil an oiread sin taomairí agus dragain ionsaighthe ag Ionchorprú na Nightmare.\nCuireann na Rúnaigh cathaithe ar fud na háite cathú ar tharrthóirí, chomh maith le rianta de chathanna éadóchasach. \n\nNuair a sháraíonn tú Incarnation of Nightmare, gheobhaidh tú Runes. {@YELLOW} Dá mhéad a théann tú, is amhlaidh is airde grád na Runes{@DEFAULT}.',
['테이머님과 드래곤이 휴식하고 서로 교감할 수 있는 숲입니다.\n\n{@YELLOW}숲의 레벨{@DEFAULT}을 올리면 더 많은 드래곤이 머무를 수 있고,\n시설의 레벨을 올릴 수 있어 보다 많은 보상을 얻을 수 있습니다.']='San fhoraois, is féidir le tamers agus dragain scíth a ligean agus idirghníomhú lena chéile. \n\nDá airde {@YELLOW} leibhéal na foraoise {@DEFAULT}, is amhlaidh is mó a bheidh dragain in ann fanacht.\nIs féidir leat leibhéal na n-áiseanna a mhéadú freisin, as a dtagann níos mó luaíochtaí.',
['유타칸의 테이머들은 혼자의 힘만으로는 물리칠 수 없는 어둠의 존재에 대항할 방법이 필요했습니다.\n클랜은 이러한 뜻이 맞는 테이머들이 연합할 수 있는 단체입니다.\n\n클랜에 소속되면 클랜 레벨에 따라 {@YELLOW}전용 버프 혜택{@DEFAULT}을 받을 수 있습니다.\n테이머는 클랜활동의 성과에 따라 상점에서 특별한 상품과 교환 할 수 있는 {@YELLOW}클랜코인{@DEFAULT}을 얻을 수 있습니다.']='I saol na Yutacáin, b\'éigean do na tamers bealach a aimsiú chun na fórsaí dorcha a aontú agus a chomhrac nach féidir a shárú má throid siad ina n-aonar.\nTá clan ar ghrúpa de chuimiléirí a tháinig le chéile chun na críche seo. \n\nNuair a bhaineann tú le clan, faigheann tú buach clan {@YELLOW}{@DEFAULT}, ag brath ar leibhéal an clan.\nBunaithe ar ghníomhaíochtaí an clan, gheobhaidh tumers {@YELLOW} Boinn Chlann{@DEFAULT } is féidir a mhalartú le haghaidh míreanna speisialta sa siopa.',
['테이머 연합에서는 테이머들의 실력 향상을 위해 그림자의 신전을 만들었습니다.\n\n이곳에서는 전 세계의 우수한 테이머와 드래곤의 능력을 똑같이 가진 그림자가 나타납니다.\n하지만 이런 강력한 그림자에게 도전하기 위해서는 먼저 콜로세움에서 자신의 강함을 증명해야만 합니다.\n\n그림자의 신전에서는 룬을 연마할 수 있는 {@YELLOW}룬 연마석{@DEFAULT}을 획득 할 수 있습니다.']='Tá Teampall na Scáthanna tógtha ag an Tamer Alliance chun cumas agus scileanna tamer a fheabhsú. \n\nTá scáthanna ag an teampall a bhfuil na stats céanna acu agus atá ar bharr na scáileanna agus na dragain ar fud an domhain.\nMar sin féin, le dul i ngleic leis na scáthanna, caithfidh tú do neart a chruthú ag an Colosseum. \n\nAg Teampall na Scáthanna, is féidir leat {@YELLOW} Rune Enchant Stone{@DEFAULT} a fháil.',
['고대의 탑에서 자신의 한계를 뛰어넘은 테이머만이 찾을 수 있는 신비로운 탑입니다.\n\n시험의 탑은 강력한 원소 에너지로 인해 {@YELLOW}탑과 같은 속성의 드래곤{@DEFAULT}만 전투에 참여할 수 있습니다.\n각 속성별 탑을 정복하면 한정 드래곤을 얻을 수 있는 {@YELLOW}절대적인 전설의 알{@DEFAULT}을 얻을 수 있습니다.']='Ní féidir ach le daoine a sháraigh a dteorainn ag an tSean-Thúr an túr mistéireach seo a aimsiú. \n\nI dTúr na dTrialacha, ní féidir ach le dragain {@YELLOW} leis an tréith chéanna leis an túr{@DEFAULT} páirt a ghlacadh sa chath mar gheall ar a fhuinneamh eiliminteach cumhachtach.\nNuair a ghlanann tú túr gach aitreabúide, is féidir leat a fháil agus {@YELLOW} Uibheacha Finscéalta Absalóideach {@DEFAULT} a gorlann isteach i dragan teoranta.',
['어둠의 추종자가 부활시킨 강력한 기계 드래곤 엑스 마키나가 활동하고 있는 던전입니다.\n\n테이머 협회는 악명이 자자한 악몽던전에서도 살아 돌아온 뛰어난 테이머만의 입장을 허락하고 있습니다.\n{@YELLOW}총 10마리의 드래곤이 전투에 참가{@DEFAULT} 할 수 있으며, 엑스 마키나를 물리치면 특별한 능력을 가진 {@YELLOW}고대 룬{@DEFAULT}과 \n드래곤의 특성 레벨을 올리는 데 사용되는 {@YELLOW}아모르의 서{@DEFAULT}를 얻을 수 있습니다.']='Tá an Ex Machina, dragan meicniúil cumhachtach aiséirí ag leantóir an dorchadais, ina chónaí sa dungeon seo. \n\nNí cheadaíonn Comhaontas Tamer ach dóibh siúd a tháinig slán as an Nightmare Dungeon iomráiteach dul isteach. \n{@YELLOW} Is féidir le suas le 10 dragan dul isteach sa chath {@DEFAULT} agus nuair a dhéanann tú an bua ar an Ex Machina, is féidir leat {@YELLOW} Sean-Rúnna{@DEFAULT} a fháil a bhfuil scileanna speisialta agus\nthe {@YELLOW} agat Leabhair Amorru{@DEFAULT} a úsáidtear le haghaidh Leibhéal suas Máistreachta.',
['태초의 룬의 힘을 가졌다고 전해지는 룬 수호자가 지키는 던전입니다.\n\n룬 수호자 던전은 마력의 흐름이 불안정해 {@YELLOW}드래그 스킬을 사용할 수 없습니다{@DEFAULT}.\n총 6개의 던전으로 나누어진 룬 수호자 던전은, 각각의 던전마다 {@YELLOW}정해진 종류의 룬{@DEFAULT}을 얻을 수 있습니다.\n테이머는 원하는 종류의 룬을 얻기 위해 던전을 선택해 입장 할 수 있습니다.']='Tá an dungeon seo cosanta ag an Rune Guardian ar a dtugtar go bhfuil cumhacht an chéad rune. \n\nI Dungeon Guardians Rune, ní féidir {@YELLOW} Drag Skill a úsáid{@DEFAULT} toisc go bhfuil sreabhadh na draíochta éagobhsaí.\nComhdhéanta de 6 dungeon, is féidir leat {@YELLOW} de chineál sonrach Rúna a fháil {@DEFAULT} ag gach dungeon.\nIs féidir leat dungeon a roghnú chun an cineál Rúnaigh atá uait a fháil.',
['오랜세월 잠들어 있던 죄악의 화신이 어둠의 세력에 의해 되살아났습니다.\n클랜원들은 힘을 합쳐 죄악의 화신을 막아내야 합니다.\n\n클랜던전에서는 {@YELLOW}10마리의 드래곤{@DEFAULT}으로 전투를 진행하며 다른 클랜원이 전투중일 경우 입장할 수 없습니다.\n보스의 남은 체력은 모든 클랜원에게 공유되며 보스에게 승리하면 더 강한 보스에게 도전할 수 있습니다.\n\n클랜던전은 1주마다 시즌이 종료되며, {@YELLOW}보스에게 입힌 피해량에 따라 보상을 얻을 수 있습니다.{@DEFAULT}']='D\'éirigh an fórsa dorcha aiséirí Incarnation of Sins tar éis codladh fada.\nAnois, caithfidh baill clan teacht le chéile chun dul i ngleic leis an bhfórsa olc seo. \n\nSa Dungeon Clan, troideann tú le {@YELLOW} 10 dragain{@DEFAULT}, agus ní féidir leat dul isteach sa dungeon nuair a bhíonn ball eile i do chónaí.\nFanann HP an Boss mar an gcéanna do gach ball den clan. Nuair a bhualann tú Boss, is féidir leat Boss níos láidre a throid. \n\nMaireann gach séasúr den dungeon ar feadh seachtaine, agus {@YELLOW} is féidir leat luaíochtaí a fháil bunaithe ar an damáiste a dhéileáil an boss.{@DEFAULT}',
['모험 도중 우연히 만난 드래곤의 기억속에서 {@YELLOW}인연 포인트{@DEFAULT}를 얻을 수 있습니다.\n드래곤의 인연 포인트가 쌓이면 부화소에서 함께 할 수 있는 동료로 소환 할 수 있습니다.\n테이머님의 친구가 발견한 인연 던전에도 들어갈 수 있습니다.']='Faigh {@YELLOW} Pointí Caidrimh{@DEFAULT} ó chuimhní na dragain a mbuaileann tú leo le linn do eachtraíochta.\nLe Pointí Caidrimh, is féidir leat do chairde a ghairm ag an nGorlann (Toghairm). \nIs féidir leat Dungeons Gaolta a d\'aimsigh do chairde a chur isteach freisin.',
['보유한 드래곤을 유타칸의 다양한 지역으로 {@YELLOW}탐험{@DEFAULT}을 보내 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.\n탐험을 보내기 위해서는 5마리의 드래곤이 필요하며, 탐험에서 발견한 룬과 자수정을 가지고 돌아옵니다.']='Seol do chuid dragain chuig {@YELLOW} taiscéaladh{@DEFAULT} réimsí eile den Yutacáin chuig {@YELLOW} leibhéal suas{@DEFAULT}.\nTá cúig dragan ar a laghad ag teastáil uait le seoladh le haghaidh taiscéalaíochta. Nuair a fhilleann siad, tugann siad ar ais Rúnais agus Aimitis a fuair siad.',
['하루에 한번 {@YELLOW}저렴한 가격{@DEFAULT}으로 상품을 구매할 수 있습니다.\n고급소환권과 골드, 모험에서 사용가능한 경험치와 골드 부스터 상품을 판매하고 있습니다.']='Uair sa lá, is féidir leat earraí a cheannach ar {@YELLOW} ar phraghas níos ísle{@DEFAULT}.\nTá ticéid Ardtoghairme, Óir, Óir Boosters, agus EXP ar féidir leat a úsáid le linn d’eachtra ar fáil le ceannach.',
['오랜 시간 유타칸 세계의 신비한 힘을 흡수해 살아 움직이게 된 {@YELLOW}거목{@DEFAULT}이 등장합니다.\n거목을 물리치면 드래곤의 친밀도를 올리는 {@YELLOW}열매{@DEFAULT}를 얻을 수 있습니다.\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Tá {@YELLOW} Crainn Mhóra{@DEFAULT} ann a d’éirigh beo tar éis dóibh cumhacht mistéireach Yutacáin a ionsú .\nNuair a sháraíonn tú na crainn sin, is féidir leat torthaí {@YELLOW} éagsúla{@DEFAULT} a fháil agus do ghaire a mhéadú le Dragons .\nAthraíonn tréithe an dungeon is féidir leat a chur isteach do gach lá den tseachtain.',
['거대용들을 물리치면 {@YELLOW}드래곤을 진화{@DEFAULT}시킬 수 있는 {@YELLOW}보석과 정기{@DEFAULT}를 얻을 수 있습니다.\n진화한 드래곤은 모습이 변화하며 새로운 스킬을 얻어 더욱 강해집니다.\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Nuair a sháraíonn tú Dragons ollmhóra, gheobhaidh tú {@YELLOW} Éabhlóid Gem and Energy{@DEFAULT} a spreagann {@YELLOW} Éabhlóid na nDragon{@DEFAULT}.\nNuair a thagann dragan chun cinn, athraíonn sé a chuma agus éiríonn sé níos cumhachtaí le scileanna nua.\nAthraíonn tréithe an dungeon is féidir leat a chur isteach do gach lá den tseachtain.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑입니다.\n매 층 클리어 시 다양한 보상을 얻을 수 있으며, {@YELLOW}층별 점수에 따라 순위가 결정{@DEFAULT}됩니다.\n고대의 탑은 2주마다 시즌이 종료되며 순위에 따라 {@YELLOW}고대주화{@DEFAULT}를 얻을 수 있습니다.']='Túr finscéalach a dhreap Tamers fadó chun iad féin a thástáil. \nFaigheann tú luaíochtaí éagsúla nuair a ghlanann tú gach urlár, agus tá tú rangaithe {@YELLOW}, bunaithe ar na pointí a scóráil tú do gach urlár{@DEFAULT}.\nMaireann gach séasúr de Thúr Ársa ar feadh 2 sheachtain, agus is féidir leat {@YELLOW} Boinn Ársa{@DEFAULT} bunaithe ar do rangú.',
['마녀 나르비는 자신의 연구에 필요한 고대 주화를 수집하기 위해 상점을 열었습니다.\n고대의 탑에서 얻은 고대 주화를 {@YELLOW}드래곤 인연 포인트{@DEFAULT}와 다양한 아이템으로 교환할 수 있습니다.\n나르비의 변덕으로 상품이 주기적으로 바뀌는 특징이 있습니다.']='D’oscail Narvi siopa chun Boinn Ársa a bhailiú dá cuid taighde.\nIs féidir na Boinn Ársa a bhailíonn tú ón tSean-Thúr a mhalartú ar {@YELLOW} Pointí Caidrimh Dragon{@DEFAULT} agus nithe eile.\nAthraíonn sí na hearraí atá ar díol gach uair uair amháin ar feadh tamaill, ag brath ar a giúmar.',
['콜로세움은 다른 테이머들과 강함을 겨룰 수 있는 경쟁의 무대입니다.\n전투에 참가한 테이머는 {@YELLOW}명예{@DEFAULT}를 획득할 수 있으며 승패에 따라 순위가 변동됩니다.\n매주 주말마다 시즌이 종료되며 순위에 따라 {@YELLOW}용맹 훈장{@DEFAULT}과 다이아를 얻을 수 있습니다.']='Is réimse cath é Colosseum inar féidir leat dul san iomaíocht i gcoinne tamers eile.\nNuair a théann tú isteach sa chath, is féidir leat {@YELLOW} Honor{@DEFAULT} a fháil agus déanfar tú a rangú bunaithe ar an toradh.\nCríochnaíonn gach séasúr an deireadh seachtaine, agus gheobhaidh tú {@YELLOW} Valor Medal{@DEFAULT} agus Diamaint de réir do rangú.',
['오래된 유적에서 발견된 신기한 캡슐을 뽑을 수 있는 곳입니다.\n캡슐을 뽑기위해서는 유타칸의 장인들이 가공한 {@YELLOW}캡슐 코인{@DEFAULT}이 필요합니다.\n캡슐중에는 {@YELLOW}전설 드래곤{@DEFAULT}과 같이 희귀한 상품이 들어있는 것도 있어 테이머들에게 늘 인기입니다.']='Is áit é seo inar féidir leat capsúil mistéireach a tharraingt atá le fáil ag fothracha ársa.\nChun capsúil a tharraingt, ní mór duit {@YELLOW} Boinn Capsúil{@DEFAULT} próiseáilte ag gaibhne i saol na Yutacáin.\nTá an-tóir ar capsúil i measc tamer mar tá míreanna annamha iontu ar nós {@YELLOW} Legendary Dragons{@DEFAULT}.',
['수많은 테이머와 드래곤을 괴롭힌 악몽의 화신이 살고있는 던전입니다.\n그들의 처절했던 전투의 흔적과 함께 룬들이 곳곳에 떨어져 있어 테이머를 유혹합니다.\n악몽의 화신을 물리치면 룬을 얻을 수 있고 {@YELLOW}높은 단계로 갈수록 등급이 더 높은 룬{@DEFAULT}을 얻을 수 있습니다.']='Is dungeon é seo ina bhfuil an oiread sin taomairí agus dragain ionsaithe ag Ionchorprú na Nightmare.\nCaithfidh na Rúnaigh atá scaipthe ar fud na háite, mar aon le rianta cathanna éadóchasach, cathú ar na daoine.\nNuair a sháraíonn tú Incarnation of Nightmare, faigheann tú Rúití . {@YELLOW} Dá mhéad a théann tú, is amhlaidh is airde grád na Runes{@DEFAULT}.',
['테이머님과 드래곤이 휴식하고 서로 교감할 수 있는 숲입니다.\n{@YELLOW}숲의 레벨{@DEFAULT}을 올리면 더 많은 드래곤이 머무를 수 있고,\n시설의 레벨을 올릴 수 있어 보다 많은 보상을 얻을 수 있습니다.']='San fhoraois, is féidir le tamer agus dragain scíth a ligean agus idirghníomhú lena chéile.\nDé {@YELLOW} leibhéal na foraoiseachta atá agat{@DEFAULT}, is amhlaidh is mó a fhéadfaidh dragain fanacht.\nIs féidir leat leibhéal na n-áiseanna a mhéadú freisin, rud a torthaí i luach saothair níos mó.',
['클랜에 소속되면 클랜 레벨에 따라 {@YELLOW}전용 버프 혜택{@DEFAULT}을 받을 수 있습니다.\n테이머는 클랜활동의 성과에 따라 상점에서 특별한 상품과 교환 할 수 있는 {@YELLOW}클랜코인{@DEFAULT}을 얻을 수 있습니다.']='Nuair a bhaineann tú le clan, faigheann tú buff clan {@YELLOW}{@DEFAULT}, ag brath ar leibhéal an clan.\nBunaithe ar ghníomhaíochtaí an clan, gheobhaidh tumers {@YELLOW} Boinn Chlann{@DEFAULT} is féidir a mhalartú le haghaidh míreanna speisialta sa siopa.',
['이곳에서는 전 세계의 우수한 테이머와 드래곤의 능력을 똑같이 가진 그림자가 나타납니다.\n하지만 이런 강력한 그림자에게 도전하기 위해서는 먼저 콜로세움에서 자신의 강함을 증명해야만 합니다.\n그림자의 신전에서는 룬을 연마할 수 있는 {@YELLOW}룬 연마석{@DEFAULT}을 획득 할 수 있습니다.']='Ag an teampall, tá scáthanna a bhfuil na stats céanna acu agus atá ar bharr na scáileanna agus na dragain ar fud an domhain.\nMar sin féin, le dul i ngleic leis na scáthanna, caithfidh tú do neart a chruthú ag an Colosseum.\nI Teampall na Scáthanna, is féidir leat {@YELLOW} Rune Enchant Stone{@DEFAULT}.',
['고대의 탑에서 자신의 한계를 뛰어넘은 테이머만이 찾을 수 있는 신비로운 탑입니다.\n시험의 탑은 강력한 원소 에너지로 인해 {@YELLOW}탑과 같은 속성의 드래곤{@DEFAULT}만 전투에 참여할 수 있습니다.\n각 속성별 탑을 정복하면 한정 드래곤을 얻을 수 있는 {@YELLOW}절대적인 전설의 알{@DEFAULT}을 얻을 수 있습니다.']='Ní féidir ach le daoine a sháraigh a dteorainneacha ag an tSean-Túr an túr mistéireach seo a aimsiú.\nAg Túr na dTrialacha, ní féidir ach le dragain {@YELLOW} leis an tréith chéanna leis an túr{@DEFAULT} páirt a ghlacadh sa chath mar gheall ar a eilimint chumhachtach fuinneamh.\nNuair a ghlanann tú túr gach aitreabúide, is féidir leat {@YELLOW} Uibheacha Seanscéalta Iomlán {@DEFAULT} a fháil a ghorann isteach i ndragún teoranta.',
['어둠의 추종자가 부활시킨 강력한 기계 드래곤 엑스 마키나가 활동하고 있는 던전입니다.\n{@YELLOW}총 10마리의 드래곤이 전투에 참가{@DEFAULT} 할 수 있으며, 엑스 마키나를 물리치면 특별한 능력을 가진 {@YELLOW}고대 룬{@DEFAULT}과 \n드래곤의 특성 레벨을 올리는 데 사용되는 {@YELLOW}아모르의 서{@DEFAULT}를 얻을 수 있습니다.']='Tá an Ex Machina, dragan meicniúil cumhachtach aiséirí ag leantóir an dorchadais, ina chónaí sa dungeon seo. \n{@YELLOW} Is féidir le suas le 10 dragan dul isteach sa chath {@DEFAULT} agus nuair a dhéanann tú an bua ar an Ex Machina, is féidir leat {@YELLOW} Sean-Rúnna{@DEFAULT} a fháil a bhfuil scileanna speisialta agus\nthe {@YELLOW} agat Leabhair Amorru{@DEFAULT} a úsáidtear le haghaidh Leibhéal suas Máistreachta.',
['태초의 룬의 힘을 가졌다고 전해지는 룬 수호자가 지키는 던전입니다.\n룬 수호자 던전은 마력의 흐름이 불안정해 {@YELLOW}드래그 스킬을 사용할 수 없습니다{@DEFAULT}.\n총 6개의 던전으로 나누어진 룬 수호자 던전은, 각각의 던전마다 {@YELLOW}정해진 종류의 룬{@DEFAULT}을 얻을 수 있습니다.']='Tá an dungeon seo cosanta ag an Rune Guardian a bhfuil a fhios go bhfuil cumhacht an chéad rune aige.\nI Dungeon Rune Guardians, ní féidir {@YELLOW} Drag Skill a úsáid{@DEFAULT} toisc go bhfuil sreabhadh na draíochta éagobhsaí.\nComhsheasmhach as 6 dungeon, is féidir leat {@YELLOW} de chineál sonrach Rune{@DEFAULT} a fháil ag gach dungeon.',
['클랜던전에서는 {@YELLOW}10마리의 드래곤{@DEFAULT}으로 전투를 진행하며 다른 클랜원이 전투중일 경우 입장할 수 없습니다.\n보스의 남은 체력은 모든 클랜원에게 공유되며 보스에게 승리하면 더 강한 보스에게 도전할 수 있습니다.\n클랜던전은 1주마다 시즌이 종료되며, {@YELLOW}보스에게 입힌 피해량에 따라 보상을 얻을 수 있습니다.{@DEFAULT}']='Sa Clan Dungeon, bíonn tú ag troid le {@YELLOW} 10 dragan{@DEFAULT}, agus ní féidir leat dul isteach sa dungeon nuair a bhíonn ball eile i do chónaí.\nTá HP an Boss mar an gcéanna do gach ball den clan. Nuair a bhuaileann tú boss, is féidir leat ceannasaí níos láidre a throid.\nMaireann gach séasúr den dungeon ar feadh seachtaine, agus {@YELLOW} is féidir leat luaíochtaí a fháil bunaithe ar an damáiste a dhéileáil an boss.{@DEFAULT}',
['입장 조건']='Coinníoll iontrála',
['악몽 던전 10단계 클리어']='Oíche Shathairn Faill Báistí Lv. 10',
['신규 콘텐츠가 오픈되었습니다']='Tá ábhar nua ar fáil.',
['확률UP 고급소환, 고급소환']='Rate UP Advanced Summon, Advanced Summon',
['2주년 스페셜 패키지']='Pacáiste Speisialta 2ú Comóradh',
['가격 비교용 상품']='Táirge le haghaidh comparáide praghas',
['가능하면, 이 차원을 떠나고 싶지 않다.']='Ba mhaith liom fanacht sa ghné seo más féidir liom.',
['그림자의 신전에서는 매 시즌마다 전세계 서버의 콜로세움 상위 랭킹의 테이머 100명이 선택되어 적으로 출현하며 룬을 연마할 수 있는  {@YELLOW}연마석{@DEFAULT}을 획득할 수 있습니다.']='Ag Teampall na Scáthanna, beidh na 100 tamer Colosseum is fearr ar domhan le feiceáil mar naimhde do gach séasúr, agus is féidir leat {@YELLOW} Enchant Stones{@DEFAULT} a thuilleamh.',
