['{@YELLOW}클랜전{@DEFAULT}은 클랜간의 경쟁 콘텐츠입니다.\n각 클랜원은 상대 클랜원을 공격해 전투를 진행하며, 전투에서 승리 시 승점을 획득합니다.\n경기가 종료 될 때, 더 많은 승점을 보유한 클랜이 경기에서 승리하게 됩니다.']='{@YELLOW} Is modh iomaíochta clan é Cogadh na gClann {@DEFAULT}.\nCuireann gach ball den clan i gcoinne baill clan comhraic agus faigheann siad pointí nuair a bhíonn an bua acu. \nAg deireadh an chluiche, bhuaigh an clan le níos mó pointí an cluiche.',
['시즌이 종료되면 조별리그와 토너먼트에서 달성한 순위에 따라 {@YELLOW}시즌 보상{@DEFAULT}을 얻을 수 있습니다.']='Nuair a chríochnaíonn an séasúr, gheobhaidh imreoirí {@YELLOW} Duaiseanna an tSéasúir{@DEFAULT} bunaithe ar a gcéim sa ghrúpa stáitse agus sa chomórtas.',
['클랜전은 2주간 진행되며 1주차 {@YELLOW}조별리그{@DEFAULT}와 2주차 {@YELLOW}토너먼트{@DEFAULT}로 구성되어 있습니다.']='Maireann Cogadh na gClann ar feadh 2 sheachtain, comhdhéanta de {@YELLOW} Group Stage{@DEFAULT} ar an gcéad seachtain agus {@YELLOW} Tournament{@DEFAULT} an tseachtain dár gcionn.',
['참가 조건을 만족하는 클랜은 별도의 참가 신청 없이 {@YELLOW}매 시즌 자동으로{@DEFAULT} 클랜전에 참가 됩니다.\n클랜전에 참가하기 위해서는 아래의 조건 중 하나를 만족해야 합니다.\n1. 이전 시즌 토너먼트 출전 기록이 있는 클랜\n2. 이전 시즌 콜로세움 랭킹 기록이 있으며 순위를 만족하는 클랜']='Tagann fine a chomhlíonann na critéir iontrála {@YELLOW} go huathoibríoch{@DEFAULT} isteach sa Chogadh Clan gach séasúr. \nChun páirt a ghlacadh i gCogadh na gClann, caithfidh clan \n1. a d\'imir an Tournament an séasúr roimhe sin nó \n2. freastal ar riachtanas rangú an Colosseum sa séasúr roimhe sin.',
['조별리그에서는 같은 조에 배정된 클랜들과 하루에 한 번 {@YELLOW}매치{@DEFAULT}를 진행합니다.\n모든 매치가 종료 된 후, 매치에서 승리한 횟수를 통해 조별 리그의 순위가 매겨집니다.\n각 조의 {@YELLOW}1,2위 클랜{@DEFAULT}은 토너먼트에 진출합니다.\n토너먼트에 진출하지 못한 클랜은 이후 일정에 참가할 수 없습니다.']='Sa Chéim Grúpa, déantar na clans {@YELLOW}{@DEFAULT} a mheaitseáil le clans eile sa ghrúpa céanna uair amháin sa lá.\nA luaithe a chríochnaíonn cluichí an Chéim Ghrúpa, déanfar na clans a rangú bunaithe ar líon na mbuanna. \n{@YELLOW} Bogfaidh clans 1ú agus 2ú háit {@DEFAULT} i ngach grúpa ar aghaidh go dtí an Tournament.\nNí féidir le clann nach bhfuil cáilithe cluichí an Chomórtais a imirt.',
['토너먼트는 하루에 한 번, 같은 조에 배치된 클랜과 매치를 진행합니다.\n매치에서 승리한 클랜은 다음 라운드에 진출합니다.\n패배한 클랜은 이후 일정에 참가할 수 없습니다. ']='Imrítear cluichí an chomórtais uair amháin sa lá i gcoinne clans eile sa ghrúpa céanna.\nRachaidh na clans a bhuaigh an cluiche ar aghaidh go dtí an chéad bhabhta eile.\nNí imreoidh an clan a chailleann an cluiche a thuilleadh cluichí.',
['게임 시작 시 최소 10명에서 최대 20명의 클랜원이 클랜원 리스트에 등록됩니다.\n클랜원 리스트는 {@YELLOW}클랜원이 더 적은 클랜{@DEFAULT}의 인원수에 맞추어 등록됩니다.\n최소 인원을 확보하지 못한 클랜은, 부족한 인원수 만큼 상대 클랜에게 {@YELLOW}부전승 승점{@DEFAULT}을 제공합니다.']='Nuair a thosaíonn an cluiche, cuirfear idir 10 agus 20 ball clan le liosta na mball clan. \nCruthaítear an liosta leis an líon ball a mheaitseálann {@YELLOW} an clan le níos lú ball{@DEFAULT}. \nCaillfidh clan gan dóthain ball {@YELLOW} pointí áirithe{@DEFAULT} do gach ball atá in easnamh, i gcomparáid leis an gclann eile.',
['게임이 시작되면 {@YELLOW}각 클랜원은 한 번의 공격 기회{@DEFAULT}를 가지게 됩니다.\n상대 클랜원을 공격하면 {@YELLOW}세트가 시작되며, 한 세트는 최대 3번의 {@YELLOW}게임{@DEFAULT}으로 진행됩니다.\n세트에서 먼저 2번의 게임을 승리하면 {@YELLOW}승점 1점{@DEFAULT}을 획득합니다.\n세트 시작 후, {@YELLOW}제한 시간{@DEFAULT}안에 승패가 결정되지 않으면 공격자의 패배로 처리됩니다.']='Nuair a thosaíonn an cluiche, {@YELLOW} beidh seans amháin ag gach ball den clan ionsaí a dhéanamh{@DEFAULT}.\nNuair a ionsaíonn tú an clan comhraic, {@YELLOW} tosaíonn an tacar, le suas le 3 chluiche {@YELLOW}{ @DEFAULT} do gach tacar. \nCibé clan a bhuann an dá chluiche, gheobhaidh sé {@YELLOW} 1 phointe{@DEFAULT}. \nMura gcinntear buaiteoir tar éis {@YELLOW} tréimhse áirithe ama{@DEFAULT}, caillfidh an clan ionsaí an cluiche.',
['게임이 종료 된 후, 양 클랜 중 승점의 합이 더 높은 클랜이 승리하게 됩니다.\n만일 두 클랜의 {@YELLOW}승점이 같다면{@DEFAULT} 아래의 규칙을 순서대로 적용해 승리 클랜을 결정합니다.\n1. 세트에 참여한 클랜원 수가 더 많은 클랜의 승리\n2. 클랜원의 게임 승리 수가 더 높은 클랜의 승리\n3. 클랜 레벨(경험치)이 더 높은 클랜의 승리\n4. 클랜 생성일이 더 빠른 클랜이 승리']='Nuair a chríochnaíonn an cluiche, is cuma cén clan ag a bhfuil níos mó pointí a bhuann an cluiche. \nMá tá {@YELLOW} na pointí céanna{@DEFAULT} ag an dá chlann, beidh feidhm ag na rialacha seo a leanas chun an buaiteoir a chinneadh. \n1. Bhuaigh an clan le níos mó ball ag teacht isteach sa tsraith an cluiche. \n2. Bhuaigh an clan le níos mó buaite ag baill an clan an cluiche. \n3. Bhuaigh an clan leis an ardleibhéal (EXP) an cluiche. \n4. Bhuaigh an clan a cruthaíodh níos luaithe an cluiche.',
['클랜원 리스트에 포함된 유저가 매치 진행중 클랜을 탈퇴할 경우, 해당 매치까지는 탈퇴한 유저의 정보가 리스트에 그대로 적용됩니다.\n매치 시작 이후 클랜에 가입한 유저는 해당 매치에 참여할 수 없습니다.\n클랜전이 진행되는 동안 클랜이 해체될 경우, 이후 예정되었던 모든 매치는 부전패 처리됩니다.']='Má fhágann ball an clan, fanfaidh a n-eolas úsáideora ar an liosta don chluiche. \nMá théann imreoir isteach sa chlann le linn an chluiche, ní bheidh sé in ann páirt a ghlacadh sa chluiche. \nMá scartar clan le linn Chogadh na gClann, caillfidh an clan gach cluiche atá le teacht.',
['조별리그에 참여한 클랜 중 {@YELLOW}상위 32개의 클랜{@DEFAULT}은 각각 다른 조에 배치됩니다.\n이후 나머지 클랜들이 무작위로 조에 배치됩니다.\n토너먼트에 진출한 클랜 중 {@YELLOW}조별리그 1위{@DEFAULT}를 달성했던 클랜은 각각 다른 조에 배치됩니다.\n이후 나머지 클랜들이 무작위로 조에 배치됩니다.']='{@YELLOW} Cuirfear na 32 clans is fearr{@DEFAULT} sa Chéim Grúpa chuig grúpaí éagsúla. \nCuirfear an chuid eile de na clans go randamach. \n{@YELLOW} Cuirfear ceannaire gach grúpa{@DEFAULT} i ngrúpaí éagsúla agus iad ag dul ar aghaidh go dtí an Tournament. \nAnsin, cuirfear na clans atá fágtha go randamach.',
