['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑으로, 탑을 정복한 자에게는 많은 보물이 주어진다고 전해집니다.\n고대의 탑과 관련해서는 다음의 내용을 잊지 마세요\n\n- 고대의 탑은 {@YELLOW}1층부터 차례대로{@DEFAULT} 올라갈 수 있으며, 매 층 클리어 시 다양한 보상을 제공합니다.\n- 이미 클리어한 층도 다시 플레이할 수 있으나, {@YELLOW}매우 소량의 보상{@DEFAULT}만 제공됩니다.\n- 고대의 탑 클리어 시 {@YELLOW}클리어 시간, 드래곤의 사망 여부{@DEFAULT}에 따라 클리어 점수를 받게 됩니다.\n- 고대의 탑 점수로 고대의 탑을 즐긴 다른 테이머 분들과의 순위가 책정되며, 이곳에서만 얻을 수 있는 희귀한 재화인 {@YELLOW}고대주화{@DEFAULT}를 포함한 많은 보상을 얻을 수 있습니다.\n  고대주화는 상점에서 {@YELLOW}매우 희귀한 드래곤의 인연 포인트{@DEFAULT}와 교환할 수 있습니다.\n- 고대의 탑의 점수 및 클리어 정보는 2주마다 한 번씩 초기화됩니다.\n\n고대의 탑의 클랜 순위는 성적 상위 20명의 점수만 반영됩니다.(보상은 클랜원 전체가 획득)']='Túr finscéalach a dhreap Tamers fadó chun iad féin a thástáil. Deirtear go mbronntar taisce iontach orthu siúd a bhuaigh an túr.\nNá déan dearmad ar an ábhar faoin tSean-Túr thíos. \n\n- Is féidir an Túr Ársa a dhreapadh ó {@YELLOW} 1F{@DEFAULT}, agus duaiseanna éagsúla a thabhairt as gach leibhéal a ghlanadh. \n- Is féidir leat leibhéil glanta a imirt arís, ach {@YELLOW} ní thabharfar ach fíorbheagán luach saothair{@DEFAULT}. \n- Nuair a imríonn tú An tSean Túr, gheobhaidh tú scór soiléir de réir {@YELLOW} am soiléir, agus marthanacht dragain{@DEFAULT}. \n- Tá tú rangaithe le Tamers eile a d\'imir An tSean-Thúr bunaithe ar do Scór Túir Ársa. Is féidir leat go leor duaiseanna a fháil lena n-áirítear an t-airgeadra cluiche annamh ar a dtugtar {@YELLOW} Boinn Ársa{@DEFAULT}. \nIs féidir Boinn Ársa a mhalartú ar {@YELLOW} Pointí Caidrimh an Dragúin{@DEFAULT} atá fíor-annamh sa siopa. \n- Athnaítear Scór na dTúr Ársa agus Eolas Glan gach 2 sheachtain. \n\nNí mheastar ach na scóir ón 20 is fearr do rangú clan an tSean-Thúir. (Faigheann gach ball clan na luach saothair.)',
