['아모르의 첫 번째 자손으로서 태초의 힘을 지닌 어둠의 수호자였다. 그러나 가장 소중한 존재를 잃고 타락했다. 세상을 파괴하고 고대신룡과 싸워 승리 직전에 아모르의 창을 맞고 쓰러졌다. 영원한 고통 속에서 살아온 이 드래곤은 모든 것의 파멸만을 원한다.']='Ba é an chéad shliocht Amorru agus caomhnóir an dorchadais a bhí i seilbh an chumhacht an tús. Mar sin féin, chaill sé an duine ba luachmhaire agus thit sé isteach sa chaimiléireacht. Scrios sé an domhan agus throid sé i gcoinne an Dia Dragon, ach bhuail sleá Amorru síos é díreach roimh an bua a bhaint amach. Ní mian leis an dragan seo, a bhfuil cónaí air i gcruachás síoraí, ach scriosadh gach rud.',
['이 드래곤의 분노는 빛을 향해 있습니다. 이 공격은 방어력, 수호, 무적, 부활등의 모든 방어 수단을 무시하며 빛 속성 대상에게는 20배의 피해를 입힙니다.전투 시작 시에 1회만 발동합니다.']='Tá fearg an dragan seo dírithe i dtreo an tsolais. Déanann an t-ionsaí seo neamhaird ar gach beart cosanta amhail cosaint, cosaint, invincibility, resurrection, etc., agus déileálann sé 20 uair an damáiste do spriocanna tréithe solais. Ní ghníomhaíonn sé ach uair amháin ag tús an chatha.',
['이벤트 기간 동안 파멸의 어둠 소환에 사용할 수 있는 소환권, 낮은 확률이지만, 파멸의 다크닉스을 소환할 수 있다고 한다.']='Le linn thréimhse an imeachta, tá ticéad toghairme ar fáil le húsáid chun dorchadas na fothracha a thoghairm. Cé gur dóchúlacht íseal é, deirtear gur féidir Summon Dorchadas of Ruin a ghairm.',
['이벤트 기간 동안 파멸의 어둠 이벤트 상점에서 사용할 수 있는 재화, 이벤트 스테이지나 이벤트 업적을 통해 획득할 수 있다.']='Le linn thréimhse an imeachta, is féidir leat airgeadra a fháil ar féidir a úsáid ag an dorchadas de stór imeacht ruin, chomh maith le céimeanna imeachtaí agus éachtaí.',
['일정 시간마다 무작위 적 하나를 공격하여 대상에게 각각 {1}% 확률로 {2}초간 공격력 감소, 방어력 감소, 공격속도 감소, 지속피해를 부여합니다.']='Gach méid áirithe ama, ionsaí randamach namhaid amháin agus tá seans {1}% agat chun {2} soicind de laghdú ionsaí, laghdú cosanta, laghdú luas ionsaí, agus damáiste thar am ar an sprioc.',
['일정 시간마다 무작위 적을 공격합니다.\n매 타격마다 공격력 감소 효과를 부여합니다.\n보스 공격 시 타겟이 적을수록 피해량이 증가합니다.']='Ionsaí naimhde randamacha go tráthrialta.\nCuir isteach éifeacht laghdaithe damáiste le gach hit.\nMéadaíonn an damáiste nuair a ionsaítear naimhde le linn ionsaithe ceannsaí.',
['일정 횟수의 일반 공격 시마다 자신의 목적을 상기시킵니다. 목적을 이루기 전 까지 발악하여 자신의 생명력을 회복합니다. 보유하고 있는 공격력 감소를 제외한 중첩 가능한 해로운 효과(방어력 감소, 공격 속도 감소, 지속 피해)의 중첩 개수 1개당 회복량이 4배로 증가합니다.']='Gach uair a dhéanann tú líon áirithe de ghnáth-ionsaithe, cuireann tú do chuspóir i gcuimhne duit féin. Go dtí go mbainfidh tú do sprioc amach, gheobhaidh tú do shláinte ar ais trí chur ina choinne. I gcás gach stack éifeachtaí díobhálacha is féidir a chruachadh, gan laghdú ar chumhacht ionsaí a áireamh, (laghdú cosanta, laghdú ar luas ionsaí, damáiste leanúnach), méadaítear an méid aisghabhála 4 huaire.',
['일정시간마다 가장 공격력이 높은 대상에게 10회에 걸쳐 튕기는 구체가 모든 방어 수단을 무시한 피해를 가합니다. 대상의 공격력이 낮을수록 피해량이 상승하며, 만약 대상의 공격력이 25000이상일 경우 피해가 무효화 됩니다.']='Gach méid áirithe ama, déanann sféar preabadh damáiste don sprioc leis an gcumhacht ionsaithe is airde thar 10 n-amas, gan aird a thabhairt ar gach cosaint. Méadaíonn méid an damáiste de réir mar a laghdaíonn cumhacht ionsaí an sprice, agus má tá cumhacht ionsaí an sprice 25,000 nó níos airde, cuirtear an damáiste ar neamhní.',
['자신의 생명력이 0이 되면 40초간 좀비 상태가 되고, 치명 확률이 비약적으로 증가합니다.\n이 때, 스킬 쿨타임이 초기화되며 마나 2를 회복합니다. \n지속 시간이 끝난 뒤 사망합니다.']='Má shroicheann do bheocht 0, rachaidh tú isteach i staid zombie ar feadh 40 soicind, agus tiocfaidh méadú suntasach ar do sheans criticiúil.\nLe linn an ama seo, athshocrófar do chuid scileanna agus gheobhaidh tú 2 mana ar ais.\nNuair a bheidh deireadh leis an ré, déanfaidh tú bás.',
