['축복 시즌은 3개월마다 변경되며 , 각 시즌 별로 특화된 옵션이 존재합니다.\n축복은 3개월 마다 {@YELLOW}초기화{@DEFAULT}가 되고 사용 중인 축복은 종료 됩니다.\n등록한 드래곤은 새로운 시즌이 시작되면 초기화 되고 재등록이 필요합니다.']='Athraíonn Séasúr Beannachta gach 3 mhí, agus tá sainroghanna ann do gach Séasúr.\nCuirtear tús le Séasúr Beannachta {@YELLOW}{@DEFAULT} gach 3 mhí, agus cuirfear deireadh le beannacht, atá in úsáid faoi láthair.\nAn Dragon cláraithe déanfar é a athshocrú nuair a thosóidh Séasúr nua agus beidh gá le hathchlárú.',
