['아모르의 축복']='Beannacht Amorru',
['드래곤을 등록 후 얻은 축복 티켓을 사용하여 축복을 받을 수 있습니다.\n\n축복은 5개의 타입이 있으며 원하지 않은 옵션이 나왔을때 다이아를 소모하여 옵션을 {@YELLOW}초기화{@DEFAULT}할 수 있습니다.\n- 초기화 시 해당 옵션에서 사용한 축복 티켓이 모두 반환됩니다.\n\n축복은 중첩이 가능하며 모든 드래곤,콘텐츠에서 적용이 됩니다.']='Tar éis duit dragan a chlárú, is féidir leat ticéad beannachta a úsáid chun beannacht a fháil. \n\nTá 5 chineál ag Blessing, agus nuair a thagann rogha nach dteastaíonn uait, is féidir leat Diamond a ithe chun {@YELLOW} a athshocrú{@DEFAULT}. \n- Sa túsú, seolfar ar ais an ticéad beannachta go léir a úsáideadh sa rogha. \n\nIs féidir beannú a chruachadh agus is infheidhme maidir le gach dragan agus inneachar.',
['전설 드래곤은 {@YELLOW}축복 티켓{@DEFAULT} 3개.\n신화 드래곤은 스킬 강화 단계에 따라 {@YELLOW}축복 티켓{@DEFAULT}이 지급 됩니다. (최대 15개 까지 획득 가능합니다.)\n\n신화 드래곤을 등록후 , 스킬 레벨업을 한뒤에 축복 시스템에 재 등록시 강화한 스킬 레벨 1당 축복 티켓 1개가 추가 지급됩니다.']='Tá 3 thicéad beannaithe {@YELLOW} ag Legendary Dragon {@DEFAULT}.\nAg brath ar an leibhéal feabhsaithe scileanna, gheobhaidh Mythic Dragon ticéad beannachta {@YELLOW}{@DEFAULT}.(Is féidir leat suas le 15 mhír ar a mhéad a fháil. ) \n\nTar éis duit Dragon miotasach a chlárú , a luaithe a bheidh tú ag leibhéalú do scileanna agus ag athchlárú sa chóras beannachta, gheobhaidh tú ticéad beannachta breise do gach leibhéal feabhsaithe scileanna.',
['축복 티켓을 얻기 위해서는 {@YELLOW}육성이 완료된{@DEFAULT} 전설, 신화 드래곤을 등록해야 합니다.\n\n- 전설 드래곤 : 레벨 / 친밀도 / 강화 / 특성 / 진화 / 스킬\n- 신화 드래곤 : 레벨 / 친밀도 / 진화\n\n드래곤을 등록하여도 모든 콘텐츠에서 사용 가능합니다.\n동일한 드래곤을 여러마리 육성하여 등록하여도 , 한마리만 등록 가능합니다.']='Chun ticéad beannachta a fháil, caithfidh tú dragan a chlárú a chríochnaigh {@YELLOW} cothú iomlán{@DEFAULT}. \n\n- Dragon Finscéalach : Leibhéal / Dlúth / Feabhsú / Máistreacht / Éabhlóid / Scil \n- Dragon Mythic : Leibhéal / Gar / Éabhlóid \n\nFiú má chláraíonn tú dragan, beidh sé ar fáil le húsáid san ábhar go léir. \nFiú má chláraíonn tú dragain iolracha, ní féidir ach ceann amháin a chlárú.',
['진정한 테이머가 되기 위한 길입니다.\n최대한 많은 드래곤을 육성 시켜 축복 시스템에 등록시키고, 획득한 {@YELLOW}축복 티켓{@DEFAULT}을 사용하여 {@YELLOW}축복 효과{@DEFAULT}를 받아보세요.']='Is é seo an bealach chun a bheith ina tamer fíor.\nCothaigh an oiread dragan agus is féidir, cláraigh sa chóras beannachta iad, agus bain úsáid as ticéid beannachta {@YELLOW} faighte{@DEFAULT} chun éifeachtaí beannachta {@YELLOW} a fháil{@DEFAULT} .',
['드래곤을 등록 후 얻은 축복 티켓을 사용하여 축복을 받을 수 있습니다.\n\n축복은 5개의 타입이 있으며 원하지 않은 옵션이 나왔을때 다이아를 소모하여 옵션을 {@YELLOW}초기화{@DEFAULT}할 수 있습니다.\n- 초기화 시 해당 옵션에서 사용한 축복 티켓이 모두 반환됩니다.\n\n축복은 중첩이 가능하며 모든 드래곤,콘텐츠에서 적용이 됩니다.\n\n특화 옵션 15단계와 기본 옵션의 10단계의 확률은 동일하며 , 특화 옵션일수록 더 높은 수치의 옵션을 획득할 확률이 높습니다.']='Tar éis duit dragan a chlárú, is féidir leat ticéad beannachta a úsáid chun beannacht a fháil. \n\nTá 5 chineál ag Blessing, agus nuair a thagann rogha nach dteastaíonn uait, is féidir leat Diamond a ithe chun {@YELLOW} a athshocrú{@DEFAULT}. \n- Sa túsú, seolfar ar ais an ticéad beannachta go léir a úsáideadh sa rogha. \n\nIs féidir beannú a chruachadh agus is infheidhme maidir le gach dragan agus inneachar. \n\nIs ionann an dóchúlacht go bhfaighfear rogha speisialaithe ag leibhéal 15 agus bunrogha ag leibhéal 10, ach tá an dóchúlacht go bhfaighfear rogha ar a bhfuil luach níos airde níos airde i gcás sainroghanna.',
['드래곤을 등록하여도 모든 콘텐츠에서 사용 가능합니다.']='Fiú má chláraíonn tú dragan, is féidir é a úsáid i ngach ábhar.',
