['드래곤과 몬스터들은 스킬을 통해서 적을 약하게 하는 효과를 부여할 수 있습니다.\n\n- {@YELLOW}공격력 감소{@DEFAULT} : 공격력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}방어력 감소{@DEFAULT} : 방어력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}공격속도 감소{@DEFAULT} : 공격속도가 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}치명확률 감소{@DEFAULT} : 치명확률이 30% 감소됩니다.\n- {@YELLOW}치명피해 감소{@DEFAULT} : 치명피해가 50% 감소됩니다.\n- {@YELLOW}치명회피 감소{@DEFAULT} : 치명회피가 30% 감소됩니다.\n- {@YELLOW}회피 감소{@DEFAULT} : 회피가 30% 감소됩니다.\n- {@YELLOW}적중 감소{@DEFAULT} : 적중이 30% 감소됩니다.\n- {@YELLOW}회복량 감소{@DEFAULT} : 회복을 받았을 때 회복량이 70% 감소됩니다.\n- {@YELLOW}기절{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다.\n- {@YELLOW}수면{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다. 공격을 받았을 때 해제됩니다.\n- {@YELLOW}침묵{@DEFAULT} : 모든 스킬을 사용할 수 없습니다.\n- {@YELLOW}지속피해{@DEFAULT} : 일정 시간마다 최대 생명력의 0.5%의 피해를 받습니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}받는 피해 증가{@DEFAULT} : 받는 피해가 25% 증가합니다. (최대 3회까지 중첩 가능)']='Is féidir le dragain agus arrachtaigh éifeachtaí díobhálacha a thabhairt do naimhde. \n\n- {@YELLOW} Laghdú ar ATK{@DEFAULT}: Tháinig laghdú 20% ar ATK. (Is féidir é a chruachadh suas le 3 huaire) \n- {@YELLOW} Laghdú DEF {@DEFAULT}: Tá laghdú 20% ar an DEF. (Is féidir é a chruachadh suas le 3 huaire) \n- {@YELLOW} Laghdú ar Luas ATK {@DEFAULT}: Laghdaítear luas ATK 20%. (Is féidir é a chruachadh suas le 3 huaire) \n- {@YELLOW} Laghdú ar an Ráta Criticiúil{@DEFAULT}: Laghdaítear an Ráta Criticiúil faoi 30%. \n- {@YELLOW} Laghdú ar Imghabháil Chriticiúil{@DEFAULT}: Tá laghdú 30% ar an Imghabháil Chriticiúil. \n- {@YELLOW} Laghdú ar Imghabháil{@DEFAULT}: Tá laghdú 30% ar an imghabháil. \n- {@YELLOW} Laghdú ACC{@DEFAULT}: Tháinig laghdú 30% ar an ACC. \n- {@YELLOW} Laghdú ar an Ráta Aisghabhála{@DEFAULT}: Laghdaíodh an méid athshlánaithe 70%. \n- {@YELLOW} Stiúradh{@DEFAULT}: Ní féidir ionsaí a dhéanamh ná scileanna a úsáid. \n- {@YELLOW} Codladh{@DEFAULT}: Ní féidir gach scil a úsáid agus ní féidir ionsaí a dhéanamh. Baineadh an stádas nuair a ionsaíodh é. \n- {@YELLOW} Tost{@DEFAULT}: Ní féidir gach scil a úsáid. \n- {@YELLOW} Damáiste DOT{@DEFAULT}: Faigh damáiste 0.5% de Max HP gach am socraithe. (Is féidir é a chruachadh suas le 3 huaire) \n- {@YELLOW} Méadú ar an damáiste a rinneadh{@DEFAULT} : Méadaíonn an damáiste a thógtar faoi 25%. (Is féidir é a chruachadh suas le 3 huaire)',
