['모험 난이도 불지옥 이상 클리어 시 아모르의 기운이 획득됩니다.\n더 높은 단계의 모험 클리어 시 아모르의 기운을 더욱 많이 획득할 수 있습니다.\n아모르의 기운을 사용하여 연구를 통해 드래곤의 능력치를 올릴 수 있습니다.\n육체와 영혼 둘 중 하나를 선택하여 능력치를 올릴 수 있으며, 다이아를 사용하여 초기화가 가능합니다.\n능력치는 영구적으로 적용이 됩니다.']='Nuair a ghlanann tú deacracht na heachtra Hellfire nó níos airde, gheobhaidh tú fuinneamh an ghráin.\nNuair a ghlanann tú eachtraí ar leibhéal níos airde, is féidir leat fuinneamh an ghrá a fháil níos mó fós.\nAgus fuinneamh an ghráin á úsáid agat, is féidir leat an fheidhmíocht a mhéadú Dragon trí thaighde.\nIs féidir leat an corp nó an t-anam a roghnú chun do chumas a mhéadú, agus is féidir leat é a athshocrú le diamaint.\nCuirtear na stats cumais i bhfeidhm go buan.',
